import { useEffect, useState } from "react";

const Todos = () => {
  const allTodos = {};
  const [todos, setTodos] = useState(allTodos);
  useEffect(() => {
    // get all todos for loggedIn user
    setTodos(allTodos);
  }, []);
  return (
    <>
      <div>NavBar</div>
      <div></div>
    </>
  );
};

export default Todos;
